"   <div class=\"cntnt\" style=\"width: 656px; height: 526px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chest radiograph (above left) shows a left hilar mass and multiple bilateral calcified pulmonary nodules. The pulmonary arteriogram (above right) shows obstruction of the left pulmonary artery and a filling defect in the right pulmonary artery. The CT scan (bottom) demonstrates ossified tumor in the left pulmonary artery (arrow), and in the periphery of the left lung.",
"    <div class=\"footnotes\">",
