var title_f3_24_3468="Fungi terminology";
var content_f3_24_3468=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F50012&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F50012&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Common fungal terminology",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       1. Fungi: plant-like organisms with no chlorophyll, with a definite nuclei and usually rigid cell walls",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Hyphae: long chains of cells that are aggregated into mats termed mycelium",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Fungi reproduce by spores which may be sexually (nuclear fusion, meiosis) formed or asexually (mitotically) formed",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       4. Fungal classes according to their method of sexual reproduction",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       a. Oomycetes produce motile, thick-walled sexual spores, one for each nuclear fusion (eg, the downy mildews). Some Oomycetes produce unispore sacs called \"sporangia\" that become airborne.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       b. Zygomycetes produce a single large thick-walled sexual spore with each nuclear fusion. Zygomycete also produce asexual spores in sporangia sacs (eg, Rhizopus, Mucor).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       c. Ascomycetes produce eight sexual spores in a sac called an ascus and asexual spores called conidia (eg, Leptosphaeria, Chaetomium, Venturia)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       d. Basidomycetes form sexual spores externally on pegs produced on structures called basidia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist3\">",
"       i. Heterobasidiomycetes produce separate septate basida (eg, rusts and smuts)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist3\">",
"       ii. Holobasidiomycetes produce single-celled club-shaped basidia (eg, mushrooms and puffballs)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       e. Deuteromycetes are fungi for which a sexual stage has not been identified (Aspergillus, Stemphylium, Alternaria, Cladosporium)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       f. Myxomycetes are organisms with both plant and animal characteristics (eg, slime molds). The vegetative stage is an amoeba or multinucleate plasmodium that moves and ingests foods.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       g. Actinomycetes are filamentous bacteria that produce dry airborne spores",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
